    primaryColor,
    secondaryColor,
    fontSize,
    fontColor,
  } = colorScheme;

  return (
    <div
      style={{
        backgroundColor: backgroundColor,
        color: fontColor,
      }} className="back"
    >
      <header className="header2" style={{ backgroundColor: secondaryColor }}>
      Dasb
      </header>
      <main style={{fontSize: fontSize }}>
        <h1></h1>
        <p>Content goes here</p>
      </main>
        </div>
  );
};

